package javaexp.a04_vo;

public class Max {
	private int quarter;
	private int max;
	public Max() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Max(int quarter, int max) {
		super();
		this.quarter = quarter;
		this.max = max;
	}
	public int getQuarter() {
		return quarter;
	}
	public void setQuarter(int quarter) {
		this.quarter = quarter;
	}
	public int getMax() {
		return max;
	}
	public void setMax(int max) {
		this.max = max;
	}
}
